Note: I tried to have a logic like



 ```

  if ("gauge".equals(metricType) || "histogram".equals(metricType)) {

  ...

  } else if ("monotonic_count".equals(metricType)) {

  ...

  } else if ("counter".equals(metricType) || "rate".equals(metricType)) {

  sendCounter(...)

  } else {

  // issue warning and deprecation

  sendCounter(...)

  }

 ```



 But the issue is that we will need to pass about 7 args to sendCounter, which is not great. That's why I went to this low changelog approach you see here that only adds the warning to existing code.

@truthbk An alternative is the have an boolean attribute like `this.isInvalidMetricTypeWarningLogged` to log only once:



 ```java

  if (!metricType.equals("counter")

  && !metricType.equals("rate")

  && !this.isInvalidMetricTypeWarningLogged) {

  log.warn("Invalid metric type " + metricType + " for metric " + metricName

  + ". The metric will be processed as rate"

  + " (this is a DEPRECATED behaviour, use a valid type instead).");

  this.isInvalidMetricTypeWarningLogged = true;

  }

 ```



 WDYT?

Tell IntelliJ's control flow analyzer that this function is pure, so the return value never changes.

 Imagine this code:



 ```java

 if (a.getBinding() instanceof A) {

  ((A) a.getBinding()).someMethodOfA();

 }

 ```



 IntelliJ will say there's a nullability issue because `getBinding()` returns nullable, even the `instanceof A` implies it's notnull. If we annotate it as pure, IntelliJ will see that the method always return the same result and won't show the error
